DNA=""

DNA=DNA.upper()

Complement=DNA.replace('A','Q')
Complement=Complement.replace('C','W')
Complement=Complement.replace('T','A')
Complement=Complement.replace('G','C')
Complement=Complement.replace('Q','T')
Complement=Complement.replace('W','G')

RComDNA=Complement[::-1]

print("Original sequence  5' "+DNA+" 3'")
print()
print("Complement         3' "+Complement+" 5'")
print()
print("Reverse Complement 5' "+RComDNA+" 3'")
